function About() {
  return (
    <div>
      <h1>About</h1>
      <h2>Brittany Yee</h2>
      <p>Software engineer based in NYC</p>
      <h3>
        Fun Facts:
        <ul>
          <li>I </li>
          <li>Node.js</li>
        </ul>
      </h3>
    </div>
  );
}

export default About;
